import styled from "styled-components";

export const Body = styled.div`
  display: grid;
  grid-template-columns: 65% 45%;
`;

export const LeftPane = styled.div`
  height: calc(100vh - 100px);
  background: red;
`;

export const RightPane = styled.div`
  height: 100vh;

  background: blue;
`;
